import * as V from 'vue'
import Router from 'vue-router'
import EnterScore from '@/views/EnterScore.vue';
import MainMenu from '@/views/MainMenu.vue';

Vue.use(Router)

const router = new Router({
    mode: 'history',
    routes: [
        {
            path: '/',
            name: 'main-menu',
            component: MainMenu
        },
        {
            path: '/enter-score',
            name: 'enter-score',
            component: EnterScore,
          }
    ]


})

export default router;
